import React from 'react';
import {Box,Grid,Typography,Button} from "@material-ui/core"

export default props =>{

    return (
        <Box>
            <Grid container>
                <Grid item xs>
                    <Typography>Frontend dev</Typography>
                    <Typography>google</Typography>
                </Grid>
                <Grid item xs></Grid>
                <Grid item xs></Grid>
            </Grid>
        </Box>
    )
}
